import React from "react";

const Picture = () => {
  const array1 = [
    {
      name: "Dublin",
      subText: "123 properties",
      image: "./images/city_1.webp",
    },
    {
      name: "Reno",
      subText: "533 properties",
      image: "./images/city_2.webp",
    },
    {
      name: "Austin",
      subText: "532 properties",
      image: "./images/city_3.webp",
    },
  ];

  return (
    <div className="img3">
      {array1.map((array1, index) => (
        <div className="img1">
          <li className="conten">{array1.name}</li>
          <li className="conten1">{array1.subText}</li>
          <img className="img2" src={array1.image} alt={array1.index} />
        </div>
      ))}
    </div>
  );
};
export default Picture;
